) Denmark's annual medical conference, Doctor Week, was held in Copenhagen November 11-15, 2019. Medical professionals attending the conference continued to pay attention to the Chinese Communist Party's (CCP) state-sanctioned organ harvesting from living Falun Gong practitioners.



Representatives of DAFOH (Doctors Against Forced Organ Harvesting) discuss forced organ harvesting in China during Doctor Week, an annual meeting of medical professionals held in Copenhagen.

The five-day event was attended by approximately 3,500 medical professionals from Denmark, Greenland, and the Faroe Islands. A small number of Nordic doctors and nurses also attended the meeting.
